import React from "react";

// import HornedBeasts from "./hornedBeast";
import data from "./assets/data.json";

class Main extends React.Component {
  render() {
    return (


      data.map((element) => {
        return (
          <Hornedbeast
            image_url={element.image_url}
            title={element.title}
            description={element.description}
          />
        );
      })
    );
  }
}

export default Main;
